  // console.log("dentists", dentists)

  return (

  

    <main className="">
      <h1>Home</h1>

    <div className='card-grid'>
        { dentists.map(dentist => (
          <React.Fragment key={dentist.id}>
            <Link to={'/dentist'}><h4>{dentist.name}</h4></Link>
            <Card dentist={dentist} key={dentist.id}/>
          </React.Fragment>
        ))}
    
    </div>

    </main>

    
  )
}
export default Home
